function generateRandomInteger(min, max) {
	
	// Generate a number between min and max, including max
	return Math.floor(Math.random() * max) + min;
}

function colorCheck () {
	var theSampler = app.activeDocument.colorSamplers.add([Math.abs(app.activeDocument.width / 2), Math.abs(app.activeDocument.height / 2)]);
	if (theSampler.color.rgb.red == theSampler.color.rgb.green && theSampler.color.rgb.green == theSampler.color.rgb.blue) {
		return "bw";
	} else {
		return "color";
	}
}

function format(){
	
	// Determine format
	if (doc_height > doc_width) {
		if (doc_height/doc_width < 1.1) {
			var format = "square";
		}
		else if (doc_height/doc_width > 1.1 && doc_height/doc_width < 1.2) {
			var format = "67";
		}
		else if (doc_height/doc_width > 1.2 && doc_height/doc_width < 1.3) {
			var format = "45";
		}
		else if (doc_height/doc_width > 1.3 && doc_height/doc_width < 1.4) {
			var format = "645";
		}
		else if (doc_height/doc_width > 1.4) {
			var format = "35mm";
		}
	}
	else {
		if (doc_width/doc_height < 1.1) {
			var format = "square";
		}
		else if (doc_width/doc_height > 1.1 && doc_width/doc_height < 1.2) {
			var format = "67";
		}
		else if (doc_width/doc_height > 1.2 && doc_width/doc_height < 1.3) {
			var format = "45";
		}
		else if (doc_width/doc_height > 1.3 && doc_width/doc_height < 1.4) {
			var format = "645";
		}
		else if (doc_width/doc_height > 1.4) {
			var format = "35mm";
		}
	}
	return format;
	
}

function choosePath(pathKind) {
	// Choosing the path
	var thisFormat = format();
	var stageFrame=[];
	
	if (thisFormat == "square") {
		if (pathKind == "frame") {
			var stagedPath = frameSquare[generateRandomInteger(1, frameSquare.length) - 1];
		} else if (pathKind == "shadow") {
			var stagedPath = shadowSquare[generateRandomInteger(1, shadowSquare.length) - 1];
		} else {
			var stagedPath = maskSquare[generateRandomInteger(1, maskSquare.length) - 1];
		}
	} 
	else if (thisFormat == "67") {
		if (pathKind == "frame") {
			var stagedPath = frame67[generateRandomInteger(1, frame67.length) - 1];
		} else if (pathKind == "shadow") {
			var stagedPath = shadow67[generateRandomInteger(1, shadow67.length) - 1];
		} else {
			var stagedPath = mask67[generateRandomInteger(1, mask67.length) - 1];
		}
	}
	else if (thisFormat == "45") {
		if (pathKind == "frame") {
			var stagedPath = frame45[generateRandomInteger(1, frame45.length) - 1];
		} else if (pathKind == "shadow") {
			var stagedPath = shadow45[generateRandomInteger(1, shadow45.length) - 1];
		} else {
			var stagedPath = mask45[generateRandomInteger(1, mask45.length) - 1];
		}
	} 
	else if (thisFormat == "645") {
		if (pathKind == "frame") {
			var stagedPath = frame645[generateRandomInteger(1, frame645.length) - 1];
		} else if (pathKind == "shadow") {
			var stagedPath = shadow645[generateRandomInteger(1, shadow645.length) - 1];
		} else {
			var stagedPath = mask645[generateRandomInteger(1, mask645.length) - 1];
		}
	}
	else if (thisFormat == "35mm") {
		if (pathKind == "frame") {
			var stagedPath = frame35mm[generateRandomInteger(1, frame35mm.length) - 1];
		} else if (pathKind == "shadow") {
			var stagedPath = shadow35mm[generateRandomInteger(1, shadow35mm.length) - 1];
		} else {
			var stagedPath = mask35mm[generateRandomInteger(1, mask35mm.length) - 1];
		}
	}
	return stagedPath;
	
}


function createPath(thisFrame, pathName) {
	// Build the path
	var thisPathPointInfo = thisFrame.split(";");
	var thisPathPointInfoProperties = [];
	
	var p = [];
	var pth = [];
	
	for (var i = 0; i < thisPathPointInfo.length; i++ ) {
		thisPathPointInfoProperties = thisPathPointInfo[i].split(" "); // Splitta thisPathPointInfo i dess properties
		
		p[i] = new PathPointInfo();
		p[i].kind = thisPathPointInfoProperties[0];
	
		var anchorString = thisPathPointInfoProperties[1].split(",");
		p[i].anchor = [anchorString[0]*1, anchorString[1]*1];
		
		var leftDirectionString = thisPathPointInfoProperties[2].split(",");
		p[i].leftDirection = [leftDirectionString[0]*1, leftDirectionString[1]*1];
		
		var rightDirectionString = thisPathPointInfoProperties[3].split(",");
		p[i].rightDirection = [rightDirectionString[0]*1, rightDirectionString[1]*1];

		p[i].typename = thisPathPointInfoProperties[4];
	}

	pth[0] = new SubPathInfo();
	pth[0].operation = ShapeOperation.SHAPEXOR;
	pth[0].closed = true;
	pth[0].entireSubPath = p;
	app.activeDocument.pathItems.add(pathName, pth);
	
}


function decideRotation(format, pathKind) {
	
	var randRotation = generateRandomInteger(1, 10) / 10 * 0.1 * -1; // How much random rotation to add.
	if (app.activeDocument.height > app.activeDocument.width ) {
		// Portrait
		if (pathKind == "frame") {
			// Only frame should have random rotation or 180 flip.
			if (generateRandomInteger(1, 3) == 3 && format != "45") {
				app.activeDocument.selection.rotateBoundary(270 + randRotation, AnchorPosition.MIDDLECENTER);
			} else {
				app.activeDocument.selection.rotateBoundary(90 + randRotation, AnchorPosition.MIDDLECENTER);
			}
		} else {
			app.activeDocument.selection.rotateBoundary(90, AnchorPosition.MIDDLECENTER);
		}
	} else {
		// Landscape
		if (pathKind == "frame") {
			app.activeDocument.selection.rotateBoundary(randRotation, AnchorPosition.MIDDLECENTER);
		}
	}
}


function adjustSelection() {
	app.activeDocument.selection.resizeBoundary(doc_scale * 100, doc_scale * 100, AnchorPosition.TOPLEFT);
	var selection_bounds = activeDocument.selection.bounds;
	var middle_horisontal = ( selection_bounds[2] - selection_bounds[0] ) / 2 + selection_bounds[0];
	var middle_vertical = ( selection_bounds[3] - selection_bounds[1] ) / 2 + selection_bounds[1];
	var delta_x = app.activeDocument.width / 2 - middle_horisontal;
	var delta_y = app.activeDocument.height / 2 - middle_vertical;
	app.activeDocument.selection.translateBoundary(UnitValue(delta_x, "px"), UnitValue(delta_y, "px"));
}

function MoveLayerTo(fLayer,fX,fY) {

  var Position = fLayer.bounds;
  Position[0] = fX - Position[0];
  Position[1] = fY - Position[1];
  fLayer.translate(-Position[0],-Position[1]);
  
}

function moveNeg(thisFormat) {
	// Calculate the movement of the negative layer
			
	if (thisFormat == "645") {
		if (ratio > 1) {
			// Portrait
			var movement_horisontal = generateRandomInteger(4, 9) * 0.1 * doc_width * 0.015 * -1;
			var movement_vertical = generateRandomInteger(1, 10) * 0.1 * doc_height * 0.002;
		} else {
			// Landscape
			var movement_horisontal = generateRandomInteger(1, 10) * 0.1 * doc_width * 0.002;
			var movement_vertical = generateRandomInteger(4, 9) * 0.1 * doc_height * 0.015;
		}
	} else if (thisFormat == "45") {
		if (ratio > 1) {
			// Portrait
			var movement_horisontal = generateRandomInteger(4, 9) * 0.1 * doc_width * 0.002 * -1;
			var movement_vertical = generateRandomInteger(1, 10) * 0.1 * doc_height * 0.002;
		} else {
			// Landscape
			var movement_horisontal = generateRandomInteger(1, 10) * 0.1 * doc_width * 0.002;
			var movement_vertical = generateRandomInteger(4, 9) * 0.1 * doc_height * 0.002;
		}
	} else if (thisFormat == "square" ) {
		var movement_horisontal = generateRandomInteger(4, 9) * 0.1 * doc_width * 0.01 * -1;
		var movement_vertical = generateRandomInteger(1, 10) * 0.1 * doc_height * 0.01;
	} else {
		if (ratio > 1) {
			// Portrait
			var movement_horisontal = generateRandomInteger(5, 10) * 0.1 * doc_width * 0.015 * -1;
			var movement_vertical = generateRandomInteger(1, 10) * 0.1 * doc_height * 0.01;
		} else {
			// Landscape
			var movement_horisontal = generateRandomInteger(1, 10) * 0.1 * doc_width * 0.01 * -1;
			var movement_vertical = generateRandomInteger(5, 10) * 0.1 * doc_height * 0.015 * 1;
		}
	}
	// Move the negative layer
	MoveLayerTo(app.activeDocument.artLayers.getByName("negative"),movement_horisontal, movement_vertical);
}




